script: |
  super -f text -I q11352.spq | sort > q11352.out

inputs:
  - name: q11352.spq
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 20 + col2 + - col2 < + col0 * col0 + + - col1 + 81;
  - name: tab0

outputs:
  - name: q11352.out
    data: |
      1
      21
      81
